import axios from "axios";

export function Ordernow(){
    const [address, setAddress] = useState()
    const getData = () =>{
        axios.get("http://localhost:9087/viewcart/"+params.userid)
            .then(response => {
                console.log(response)
                setCart(response.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    useEffect(()=>{
        getData()
    },[])
    return(
        <>
            <label>Choose Address</label>

        </>
    )
}
